import logo from './../images/GitHubLogo.png';
import searchIconSmall from './../images/SearchIconSmall.png';

import Input from './common/Input';

function Nav(){
    return(
        <nav class="nav">
            <div class="container">
                <div class="nav-wrapper">
                    <div class="logo-block">
                        <img src={logo} alt="Logo image"></img>
                    </div>
                    <div class="search-block">
                        <img src={searchIconSmall} alt="Search icon"></img>
                        <Input class="search-field" type="text" placeholder="Enter GitHub username" />
                    </div>
                </div>
            </div>
        </nav>
    );
}

export default Nav;
